import React from 'react';
import './App.css';
import Header from './Header';
import Greeting from './Greeting';
import EntriesList from './EntriesList'

class Core extends React.Component {
  render(){
    return (
    <div className="App">
        <Header />
        <Greeting />
        <EntriesList />
    </div>
    );
  }
}

export default Core
